import { Link } from 'react-router-dom';
import './Product.css';

import api from '../services/api';

export default function Products(products) {

  var _products = [
    {
      title: "Skol 269ml",
      images: {
        url: "skol.jpg"
      },
      productVariants:[
        {
          old_price: 2.09,
          price: 1.99,
        }
      ]
    },
    {
